import React from 'react';
import '../Navbar/Navbar.css';
import logo from '../../Assets/code.png';
import { Link } from 'react-scroll';
import contactImg from '../../Assets/contact.png';
import Intro from '../Intro/Intro.js';

const Navbar = () => {
    return (
        <nav className='navbar'>
            {/* <img src={logo} alt='Logo' className='logo' /> */}
            <div className='desktopMenu'>
                <Link activeClass='active' to='intro' spy={true} smooth={true} offset={-100} duration={500} className='desktopMenuListItem'>Home</Link>
                <Link activeClass='active' to='skills' spy={true} smooth={true} offset={-10} duration={500} className='desktopMenuListItem'>About</Link>
                <Link activeClass='active' to='works' spy={true} smooth={true} offset={-10} duration={500} className='desktopMenuListItem'>Portfolio</Link>
            </div>
            <Link activeClass='active' to='Con' spy={true} smooth={true} offset={-100} duration={500}>
            <button className='desktopMenuBTN'>
                <img src={contactImg} alt='Contact' className='desktopMenuIMG' />Contact Me
            </button>
            </Link>
        </nav>
    )
}

export default Navbar;
